            req?.files?.user?.[0]?.filename || 'default_user.png';
        if (
            !newManagerData.phone ||
            !newManagerData.password ||
            !newManagerData.email ||
            !newManagerData.firstName ||
            !newManagerData.lastName ||
            !newManagerData.gender ||
            !newManagerData.dob
