const jwt = require('jsonwebtoken');

const verify_Token = (req, res, next) => {
    const token = req.headers.token;
    if (token) {
        // const accessToken = token.trim().split(' ')[1];
        const accessToken = token.trim();
        jwt.verify(accessToken, process.env.JWT_ACCESS_KEY, (err, user) => {
            if (err) {
                return res.status(403).json({
                    resCode: 403,
                    resMessage: 'Token is not valid.'
                });
            }
            req.user = user;
            next();
        });
    } else {
        return res.status(401).json({
            resCode: 401,
            resMessage: 'You are not authenticated.'
        });
    }
};
const verify_Token_Admin = (req, res, next) => {
    verify_Token(req, res, () => {
        if (req.user.role === 'admin') {
            next();
        } else {
            return res.status(403).json({
                resCode: 403,
                resMessage: 'You are not allowed to perform this action.'
            });
        }
    });
};
const verify_Token_Manager_Admin = (req, res, next) => {
    verify_Token(req, res, () => {
        if (req.user.role === 'admin' || req.user.role === 'manager') {
            next();
        } else {
            return res.status(403).json({
                resCode: 403,
                resMessage: 'You are not allowed to perform this action.'
            });
        }
    });
};
const verify_Token_UserId_Admin = (req, res, next) => {
    verify_Token(req, res, () => {
        if (req.user.id == req.params.userId || req.user.role === 'admin') {
            next();
        } else {
            return res.status(403).json({
                resCode: 403,
                resMessage: 'You are not allowed to perform this action.'
            });
        }
    });
};
const verify_Token_UserId_Manager_Admin = (req, res, next) => {
    verify_Token(req, res, () => {
        if (
            req.user.id == req.params.userId ||
            req.user.role === 'admin' ||
            req.user.role === 'manager'
        ) {
            next();
        } else {
            return res.status(403).json({
                resCode: 403,
                resMessage: 'You are not allowed to perform this action.'
            });
        }
    });
};

module.exports = {
    verify_Token,
    verify_Token_Admin,
    verify_Token_UserId_Admin,
    verify_Token_Manager_Admin,
    verify_Token_UserId_Manager_Admin
};

